      "fraction: ['4/5', '3.5/5', '6/10', '2/5', '3/5']\n",
      "other: ['', 'C-plus', 'high +1 out of -4..+4', 'ZERO STARS', 'A-minus']\n",
      "letter grade: ['C+', 'B-', 'B', 'C', 'C-']\n",
      "number: ['13.20', '1.5', '1', '3.5', '4.5']\n",
